import React from 'react';
import './header.css';

const Header = () => {
  return (
    <header className="header">
      <div className="header-top">
        <div className="location">
          <span>Ваш город: Москва</span>
        </div>
        <nav className="nav">
          <a href="#">Информация</a>
          <a href="#">Сотрудничество</a>
          <a href="#">Доставка</a>
          <a href="#">Оплата</a>
          <a href="#">Гарантия</a>
          <a href="#">Новости</a>
          <a href="#">Журнал</a>
          <a href="#">О магазине</a>
          <a href="#">Контакты</a>
        </nav>
      </div>
    </header>
  );
}

export default Header;
